import '../CSSContents/AboutUs.css'
function AboutUs() {
    return (
        <div className="Aboutus-background">
            <div className='main' >
                <img className='AboutUs-pic'
                    src='images/About-us.png' height={300} width={500}
                    alt='About Us'
                />

                <div className='AboutUs-content'>
                    <h1>Welcome to our website</h1>
                    <p>We are a business that helps other businesses reduce their CO2 emissions and become more environmentally friendly. Our mission is to make the world a better place by promoting sustainable practices and reducing the impact of businesses on the environment. We offer a range of services and solutions to help our clients reduce their carbon footprint and become more environmentally conscious.</p>
                    <p>We believe that every business has the power to make a positive impact, and we are dedicated to providing the support and resources they need to do so. Whether you are a small startup or a large corporation, we are here to help you reduce your environmental impact and become a leader in sustainable business practices.</p>
                </div>



            </div>

        </div>
    )
}

export default AboutUs;
